(14981, 10527, 0, 1, '十字路口', '這首歌是離開一個我很喜歡的工作，但卻因為其它原因\r\n讓我覺得生活慢慢陷入痛苦，於是我下定決心下寫的歌\r\n每次離開不同的環境，總是會讓自己成長不少\r\n後來發現…其實離開並不是最難的事，而是下定決心是最難的\r\n就像男女交往一樣，無論你在對方身上看到什麼缺點、優點\r\n當你覺得對方並不適合你的時候，下定決心才是最難的，並不是離開\r\n', '0000-00-00 00:00:00', 0000, 0, 1, 2, '十字路口 Crossroads   詞/曲:康綺\r\n\r\nBridge:\r\n外面傳來鬧鬧哄哄 而我獨自面對著寂寞\r\n腦袋空空只剩下骨頭 找到屬於我的自由\r\n\r\nRap 1:\r\n我說是如果 今天以後 而我不是我\r\n所有身體病痛 數不完夢想霓虹\r\nIt’s not your fault\r\nJust pretend I have never been born\r\n換個方式繼續活著 我會成為傳說\r\n\r\nSo that’s all\r\nThe morning rain clouds up my window\r\n是應該休息夠了 雙眼無神一臉倦容\r\n局勢已經失控 而我真是沒用\r\n棉被壓在我的胸口 什麼時候變的懦弱\r\n\r\n失敗找理由 成功不是放手一搏\r\n站在十字路口的我現在感到困惑\r\n每個故事結局不同 對或錯的選擇\r\n緊握著我的拳頭 往前走還是墮落\r\n\r\n行屍走肉活著 日子還是要繼續過\r\n所有事情一錯再錯 Welcome back hell\r\nWhat’s wrong this world,I will never know myself\r\nI can’t see at all And can’t break down the wall\r\n\r\nChorus:\r\n每當走到十字路口 會永遠選擇向前衝 (不要講 I want you know)\r\n沒有後悔從不思索 就算倒在血泊之中 (堅持我嘅自我 其實亦冇錯)\r\n過著不是想要生活 馬戲團裡假扮小丑 (是非有咁多 呢個係我罪過)\r\n看見人們懵懵懂懂 一字一句都是玩弄 (世界比鬥殘酷 誰福薄亦難估)\r\n\r\nRap 2:\r\nYo欺負過我的朋友 我會記得你們輪廓\r\n身邊批判者太多 陰暗角落有人恨我\r\n就算咬你一口 反應直覺都是被動\r\n是的我不是溫柔 說一聲你保重\r\n\r\n一隻又一隻哈巴狗 只是為了討生活\r\n結果走在人前背後 偷偷挖著狗洞\r\n看你笑的燦爛 嘴角揚起了笑容\r\n誰是犧牲者 掉入你製造的漩渦\r\n\r\nOh shit 括起一陣風 我來不及喊痛\r\n聰明的人站在對的牆邊 炮火進攻\r\n煙火劃過夜空 而我不能再沉默\r\n是誰血在流 躲在角落顫抖\r\n\r\n咬著自己的傷口 抵著喉嚨的槍托\r\n一陣一陣炮聲隆隆 像音樂盒在演奏\r\n曠野嗅著屍臭 案發後尋找線索\r\n映入眼簾屍首 儘是無辜Loser So...\r\nChorus:\r\n每當走到十字路口 會永遠選擇向前衝 (不要講 I want you know)\r\n沒有後悔從不思索 就算倒在血泊之中 (堅持我嘅自我 其實亦冇錯)\r\n過著不是想要生活 馬戲團裡假扮小丑 (是非有咁多 呢個係我罪過)\r\n看見人們懵懵懂懂 一字一句都是玩弄 (世界比鬥殘酷 誰福薄亦難估)', '', 259, '', '康綺', '康綺', '康綺', 'Elin.W', '', 0, 0, 1, '2009-02-21 23:25:21', '2013-10-07 17:14:22', '0000-00-00 00:00:00'),
