(14987, 10597, 0, 1, '南半球', '一張機票 一個假期 可以把寒冬變成炎夏\r\n讓我們一起飛向南半球吧~', '2010-02-22 00:00:00', 0000, 0, 1, 15, '南半球\r\n\r\nI don''t like the winter\r\n灰色的天空襯著冰冷空氣\r\n濛濛的雨總是下不停\r\n弄濕了 機車騎士的腳底\r\n\r\ni don''t like the winter\r\no o o always短短的溫度計\r\n準時起床是個難題\r\n氣象報告總說寒流要繼續\r\n\r\n讓我飛向南半球\r\nBrisbane的陽光 等我\r\n海灘 日光 和啤酒\r\n提早六個月享受\r\n\r\n讓我飛向南半球\r\nsummer比winter友善的多\r\n假期 行李 拋開工作\r\n一張機票換來萬里晴空', '', 232, '', '樊哲忠', '樊哲忠', '小孩大人', '', '', 0, 1, 0, '2009-02-22 05:18:29', '2015-03-12 13:38:07', '0000-00-00 00:00:00'),
