(15000, 10628, 0, 1, '颱風愛', '感人肺府真情告白', '2008-11-11 00:00:00', 0000, 0, 1, 10, '颱風夜我的心 想到都是妳的臉 \r\n要下雨我的傘 卻放在7-11裡面 \r\n我只好淋著雨 害怕我的機車被偷走 \r\n小偷是淹大水 沒想到妳就沒有機車了\r\n\r\n希望妳的機車不見 這樣我就可以載著妳\r\n可是要加滿92 所以 一人一半 不要都是我付錢\r\n希望他的汽車不見 這樣他就不能來找妳\r\n可是它很大台 而且 還很硬朗 我好想把它砸爛\r\n\r\nos:黑漆漆的颱風夜，好希望可愛女孩的機車不見\r\n　　被風吹走，被水沖走，被小狗咬走\r\n　　這樣我就可以，載著她，去買泡麵\r\n', '', 168, '', '黃榮炮', '黃榮炮', '', '', '', 0, 0, 1, '2009-02-23 12:19:24', '2013-10-07 17:14:22', '0000-00-00 00:00:00'),
(15001, 10628, 0, 3, '美麗的粒粒皆辛苦', '愛上美麗的女孩很辛苦\r\n', '2008-11-11 00:00:00', 0000, 0, 1, 7, '很故意 不接電話\r\n很刻意 不打電話 \r\n妳讓我著迷但是心不美麗\r\n總是要讓妳開心\r\n卻覺得自己像廁所的報紙\r\nㄧ張ㄧ張被妳用盡\r\n\r\n妳說我不了解妳 \r\n應該是妳太善變\r\n對不起說了好幾百遍\r\n可是我現在比較想叫妳去吃大便\r\n\r\n也許在妳心裡面我像是一碗泡麵\r\n吃完就丟很方便不太花錢\r\n但是在我心裡面你像是高級餐點\r\n沒錢去吃 也不敢點\r\n\r\n很故意 不接電話\r\n很刻意 不打電話 \r\n妳讓我著迷但是心不美麗\r\n總是要讓妳開心\r\n卻覺得自己像廁所的報紙\r\nㄧ張ㄧ張被妳用盡\r\n', '', 206, '', '黃榮炮', '黃榮炮', '', '', '', 0, 0, 1, '2009-02-23 12:25:33', '2013-10-07 17:14:22', '0000-00-00 00:00:00'),
(15002, 10628, 0, 2, '我希望我是毒蟲', '抄襲黃榮炮的', '2008-11-11 00:00:00', 0000, 0, 1, 8, '我醒來了\r\n我回來了\r\n我真的不想\r\n又回到這生活\r\n\r\n我醒來了\r\n我回來了\r\n我真的不想\r\n又回到這生活\r\n\r\n我也不會分清左右\r\n不再計較會有的作用\r\n躺在你的手裡\r\n說這沒有理由\r\n\r\n我醒來了\r\n我回來了\r\n我只想再一次\r\n那迷濛的揮霍\r\n\r\n想了太多想了太久\r\n該死的ㄧ切不會從頭\r\n也許存在真實的自我\r\n現實中不存在的我\r\n\r\n我的靈魂他是怎麼想\r\n也許是活在記憶中的天堂\r\n管他 , 就這樣\r\n我只是不想,再待在這個地方\r\n啊~~~在偏狂裡的想法\r\n也許在你的心裡只是一種嚮往\r\n\r\n', '', 238, '', '黃榮炮', '黃榮炮', '', '', '', 0, 0, 1, '2009-02-23 12:30:28', '2013-10-07 17:14:22', '0000-00-00 00:00:00'),
