(15009, 9827, 0, 1, 'Hey Girls ( 我愛中山女中2009 )(Remix)', '在此由衷感謝SoundbosS吉他手 敬之學長 \r\n\r\n\r\nGuitar / Vocal 周棠棠\r\nBass 徐小黑\r\nDrum 李小玉\r\n\r\n我愛中山女高 我愛中山女中 \r\n我愛台北第二高女 我愛台北市立中山女子高級中學\r\n\r\n再補一句 我愛中山 !!!!\r\n你說甚麼都傷不了我 因為我已經瘋了 ', '0000-00-00 00:00:00', 0000, 0, 2, 2, 'Hey girls !\r\nin uniform \r\nYou make me\r\nfeel wonderful !\r\n\r\nHey girls !\r\n中山女中\r\n我的心\r\n蠢蠢欲動\r\n\r\n白色的上衣\r\n黑色短裙\r\n有一種魔力\r\n無法抗拒\r\n\r\n她們的美麗\r\n無庸置疑\r\n讓我的神經\r\n( 快要不行! )\r\n\r\n\r\n嘿 \r\n我今年虛歲都二十一\r\n卻還是一樣不長進\r\n想想這到底是甚麼原因\r\n我想大概是假裝年輕\r\n', '', 249, '', '棠棠', '棠棠', 'SoundbosS 吉他手 敬之', 'Rosewood Honey Trio Inc.', '', 0, 0, 1, '2009-02-24 00:19:44', '2013-10-07 17:14:22', '0000-00-00 00:00:00'),
