(15011, 10485, 0, 1, '為什麼一定要當個嬉皮?', '', '2011-05-09 00:00:00', 0000, 0, 1, 7, '繽紛絢麗的七零年代 有一股勢力高聲吶喊\r\n射穿藍儂的那顆子彈 開啟了憤怒的世代\r\n\r\n而愛與和平都不存在 說穿了只想瘋狂的作愛\r\n當死神降臨的時刻 什麼都不再 我們也不再\r\nWhat fucking death\r\n\r\n我只想要妳專注專注的看我一眼\r\n不需要透漏我軟弱的一切\r\n我只想要快樂的度過每一天\r\n假裝嬉皮的歲月 並非笑聲的來源\r\n(拿下面具的時候 得到真實的自由)\r\n\r\n沉迷白色暴動的承諾 展示抗爭批鬥的成就\r\n為叛逆而叛逆的行動 只是一種好玩的念頭\r\n\r\n為何一定要走上街頭 其實我只想快樂的活\r\n沒有切格瓦拉那樣有種 傻傻作個夢 然後睡過頭\r\n\r\nI want to be myself, I want you call my name\r\nI''m not a hippy but just dance', '', 203, '', '心機', '心機', '', '', '', 1, 0, 0, '2009-02-24 13:12:18', '2015-03-12 13:38:08', '0000-00-00 00:00:00'),
(15012, 10485, 0, 2, '紅髮少年', '這首歌是紀念我去世的朋友土壕，還有我們逝去的青春\r\n他也是個搖滾咖，\r\n熱愛著mansun，radiohead、還有打鼓，\r\n某天我看到他曾寫給我的信，\r\n「給很想長高的心機」，信中全部是溫暖熱血的打氣。\r\n之後很想寫一首歌送給他，\r\n醞釀了兩年，每次總是達不到滿意的狀態，\r\n如果他還在的話，一定會跟我說「我才不要用這種鬼東西紀念我」，\r\n2008年當兵的前兩周，終於完成這首歌，\r\n並且去錄音室錄出來。\r\n\r\n紅髮少年指的是當時的我，\r\n疾靜.疾寥.疾迫\r\n是他最後留在msn上的暱稱\r\n副歌就是講以前我們常常做的事\r\n就是在晚上聊天，聊天，聊天，\r\n聊到他忘記自己身體有什麼不適。\r\n然後副歌最後一句可能很難懂，\r\n因為這個典故是某個晚上他來我家，\r\n用寶特瓶裝了一隻他抓到的蟬，\r\n然後整個很噁心，因為蟬在裡面一直飛很像蟑螂，\r\n但是他就是很喜歡這隻蟬。\r\n\r\n這是我最後一次跟他見面，\r\n之後再見面就是葬禮上了，\r\n我對他的遺憾，就像那句英文歌詞寫的，\r\n我很對不起沒有試過好好去關心他最後一段日子。\r\n\r\n我們是彼此生命中的過客，\r\n但是土豪的搖滾力量一直庇佑著我們，謝謝', '2011-05-09 00:00:00', 0000, 0, 1, 7, '塵封已久的筆跡    喚起了他一些情緒\r\n用生命鮮血寫的信  充滿期待的光明\r\n紅色頭髮的少年    忽視著痛苦的一切\r\n疾靜疾寥的朋友    他正疾迫的遠走\r\n\r\n微涼的風    陽光依舊\r\n熟悉的街頭  吞噬你我\r\n漫漫夜空    聊同樣的事  忘了疼痛\r\n\r\n紅色頭髮的少年  染回一頭烏黑\r\n做無聊的夢      重複平凡的夜\r\n青春失去了氣味  隨他一同長眠\r\n蟬聲響起        只是一種錯覺\r\n\r\nI want a sign..but I didn’t try', '', 322, '', '心機', '心機', '激情睫毛', '', '', 0, 0, 1, '2009-02-24 13:15:37', '2013-10-07 17:14:22', '0000-00-00 00:00:00'),
