(15017, 10485, 0, 5, '使命感', '', '2009-02-24 00:00:00', 0000, 0, 1, 7, '天空又下起大雨\r\n關上了窗做個決定\r\n不想當個大明星 太矯情\r\n\r\n隨手關上冷氣機\r\n熱得好想跳進海裡\r\n新世代的使命感不能忘記\r\n\r\n地平線 在哪裡 我站著 看不清\r\ngive it walk\r\ngive it passion\r\n\r\n日記裡的孩子氣 招喚我的熱情\r\nlet it work \r\ndo something', '', 222, '', '', '', '', '', '', 1, 0, 0, '2009-02-24 13:49:14', '2015-03-12 13:38:08', '0000-00-00 00:00:00'),
