(15022, 10688, 0, 1, 'Paradise Girl', '', '0000-00-00 00:00:00', 0000, 0, 1, 10, 'A1\r\n我有  一個朋友叫做Elmo\r\n穿著  有點古著是個鼓手  也很幽默\r\n\r\nA2\r\n他  告訴我  在東區  有一個女孩\r\n他看了  很喜歡\r\n\r\n但  不知道  她叫什麼  我們都叫她\r\nParadise Girl\r\n\r\nB1\r\nOh~Elmo  勇敢說出口\r\n別擔心   她不會說NO\r\n\r\nB2\r\nParadise Girl  Paradise Girl  Paradise Girl\r\n有沒有男友\r\n\r\nParadise Girl  Paradise Girl  Paradise Girl\r\n快和他牽牽手', '', 239, '', 'THE KIDs', 'THE KIDs', '獨立製作', '獨立發行', '', 0, 1, 0, '2009-02-25 00:22:06', '2015-03-12 13:38:08', '0000-00-00 00:00:00'),
(15023, 10688, 0, 2, '再一次', '', '0000-00-00 00:00:00', 0000, 0, 1, 4, 'verse\r\n天亮了睡醒了  陽光輕輕輕輕的閃爍著\r\n我眼睛\r\n\r\n空氣依然清新  依然安靜安靜卻少了一\r\n些氣息\r\n\r\n太多思緒亂了沒有整理\r\n不想理\r\n\r\nchrous\r\n還是常常想起  你難過的表情\r\n網誌裡的字句  透露你的心情\r\n簡短的問候你  聊聊近況刻意保持距離\r\n卻傷了你\r\n\r\n如果重來一次  我還是會愛你\r\n但不會告訴你  偷偷擺在心裡\r\n我會悄悄的看著你  讓你帶著沒有我的\r\n我的回憶  走下去\r\n\r\nverse2\r\n想起了很多回憶和回憶\r\n即使到現在依然清晰\r\n我知道我相信我很幸運 \r\n遇見了你', '', 283, '', 'THE KIDs', 'THE KIDs', '獨立製作', '獨立發行', '', 0, 1, 0, '2009-02-25 00:28:01', '2015-03-12 13:38:08', '0000-00-00 00:00:00'),
(15024, 10688, 0, 3, 'PLZ Smile', '', '0000-00-00 00:00:00', 0000, 0, 1, 4, 'OH 飛 飛到妳的身邊\r\n心情不在疲倦\r\n當看著你 世界就站再我這一邊\r\n\r\nverse1\r\n每天都有不同事情發生\r\n不管怎樣都是要面對一切\r\n想一想好像也沒有什麼\r\n笑一笑也許會更快樂一點\r\n\r\nverse2\r\n現在起我們要一起玩樂\r\n現在起我們要一起Happy Forever\r\n現在起我們要一起唱歌\r\n唱出我們最快樂的歌聲\r\n\r\nchrous\r\nOH 飛 飛到妳的身邊\r\n妳開始有笑臉\r\n眼袋不見 期待有更好的明天\r\n\r\nOH 飛 飛到妳的身邊\r\n心情不在疲倦\r\n當看著你 世界就站再我這一邊', '', 247, '', 'THE KIDs', 'THE KIDs', '獨立製作', '獨立發行', '', 0, 1, 0, '2009-02-25 00:33:47', '2015-03-12 13:38:08', '0000-00-00 00:00:00'),
(15025, 1932, 0, 1, '愛哭痣', '', '0000-00-00 00:00:00', 0000, 15, 0, 15, '床上有隻蜘蛛 (路上有死老鼠)\r\n\r\n女孩嚇哭了\r\n\r\n牆上有隻壁虎(地上有大蟑螂)\r\n\r\n女孩嚇哭了\r\n\r\n電影超級感人(肚子餓到不行)\r\n\r\n女孩也哭了\r\n\r\n遇見了機八壞人(生日會太感動了)\r\n\r\n女孩又哭了\r\n\r\n氣哭了(樂哭了)\r\n\r\n\r\n\r\n他們說妳有雙大眼睛\r\n\r\n不應該每天紅腫 噢 像隻金魚\r\n\r\n噢噢噢\r\n\r\n我卻說那個叫愛哭痣\r\n\r\n(因為)眼下有痣的人說話都不真實\r\n\r\n噢噢噢\r\n\r\n\r\n我是個算命師\r\n\r\n我眼下也有痣', '', 212, '', 'Niggy ', 'Niggy ', 'The Fever Cats', '', '', 1, 1, 0, '2009-02-25 00:39:49', '2015-03-12 13:38:08', '0000-00-00 00:00:00'),
